import "./style.css"
//import styled from "styled-components";
function Header(){
  return <h1>React Calculator</h1> ;
}
export default function Buttons() {
  const buttons = ["+", "7", "8", "9" , "-", "4" , "5" ,"6"  , "*", "1", "2" ,"3" , "/", "0", "."];

  return(
    <>
    <Header/>
    <div id="keys">
      {buttons.map((x) => {
        return <button key={x}>{x}</button>
      })}
    </div>
    </>

  );

}
